import axios from "axios";

const USER_REST_API_URL = "http://localhost:8102/users";

class UserService {

    loginUser(username, password) {

        const json = JSON.stringify({ 
            "firstName": "TEST", 
            "lastName": "USER",
            "userCredentials": {
                "username": username,
                "password": password
            },
            "email": "testemail@gmail.com",
            "phoneNumber": "206-698-2700",
            "_class": "com.gcu.model.User"
         });

        return axios.post("http://localhost:8102/", json);
        //return axios.get("http://localhost:8102/users/" + username + "/" + password);
    }

    getAll() {
        return axios.get(USER_REST_API_URL)
    }

    // get(id) {
    //     return axios.get(USER_REST_API_URL + "/" + id);
    // }
}

export default new UserService();
